void foo(int a, int b = 20, int c = 30);
// b и c с аргументами по умолчанию
foo(10); // вызов foo, a = 10, b = 20, c = 30
foo(10, 15); // a = 10, b = 15, c = 30
foo(10, 15, 40); // a = 10, b = 15, c = 40
// вызывается одна и та же функция, аргументы по умолчанию
// подставляются во время компиляции
